INSERT INTO "public"."pdfTemplates" ("id", "name", "description", "content", "templateType", "pageSize", "margins", "isDefault", "isActive", "authorId", "projectId", "createdAt", "updatedAt") VALUES
	(6, 'test contract', '', '<p>This Application / Agreement ("Agreement") is between</p><h3>Thomas</h3><p>thomas</p><p>, owner or legal representative of</p><ul><li>lovedtoo</li></ul><p>("Exhibitor")</p><h3>AND</h3><h3>SCOPE {{NAME_1}} Inc</h3><ul><li>, a {{NAME_2}} corporation residing at {{ADDRESS_1}}., {{ADDRESS_4}}, {{NAME_3}} ("Organizer")</li></ul><h3>AGREEMENT</h3><p>1</p><p>.</p><p>The Terms and Conditions of this Agreement when signed electronically (and any addenda attached hereto) using the</p><p>Organizer''s {{NAME_4}} Center ("ERC") shall be the Terms and Conditions applicable to Exhibitor''s lease of</p><p>booth space from Organizer regarding participation in the contemporary art exhibition in {{NAME_5}}, {{NAME_3}}</p><p>known as SCOPE {{NAME_5}} 2024 during the dates of</p><p>{{DATE_1}} - {{DATE_2}}</p><ul><li>("Exhibition"). All</li></ul><p>dates and location are subject to change and Organizer cannot be held liable for any changes in dates and or location.</p><p>Location of the Exhibition hours and preview is at the discretion of SCOPE {{NAME_1}} Inc. The Terms and Conditions of</p><p>this Agreement shall also cover any additional days required for Exhibitor to move-in and move-out of the booth space</p><p>at the Exhibition. Exhibitor and Organizer agree as follows:</p><p>2</p><p>.</p><p>This Agreement is governed solely by the laws of the State of {{NAME_2}}. In the event of any and all litigation arising</p><p>from this Agreement, the parties hereby agree that the sole venue for all legal action will lie exclusively in the</p><p>appropriate Courts of the City of {{NAME_2}}, {{NAME_2}}. The parties agree to waive trial by jury in any and all litigation</p><p>arising from this Agreement. In the event of any arbitration or litigation between the parties under this Agreement, the</p><p>prevailing party will be entitled to reasonable attorney''s fees and costs, in the arbitration and at both trial and</p><p>appellate levels. The parties have participated jointly in the negotiation and preparation of this Agreement. In the</p><p>event an ambiguity or question of intent or interpretation arises, this Agreement will be construed as if drafted jointly</p><p>by the parties and no presumption or burden of proof will arise favoring or disfavoring any party by virtue of the</p><p>authorship of any of the provisions of this Agreement. The parties intend that each covenant, term and condition</p><p>contained herein will have independent significance. If any party has breached any covenant, term or condition</p><p>contained herein in any respect, the fact that there exists another covenant, term or condition relating to the same</p><p>subject matter (regardless of the relative levels of specificity) which the party has not breached will not detract from or</p><p>mitigate the fact that the party is in breach of the first covenant, term or condition. The rights and remedies provided</p><p>by this Agreement are cumulative, and the use of any one right or remedy by either party will not preclude or waive its</p><p>right to use any or all other remedies. Said rights and remedies are given in addition to any other rights the parties</p><p>may have by law, statute, ordinance, or otherwise. Organizer may, in its sole and absolute discretion, waive any</p><p>covenant, term or condition or the breach thereof contained herein, however, no covenant, term or condition or the</p><p>breach thereof will be deemed waived, except by written consent of Organizer, and any waiver of the breach of any</p><p>covenant, term or condition contained herein will not be deemed to be a waiver of any preceding or succeeding breach</p><p>of the same or any other covenant, term or condition. This Agreement will bind both Organizer and Exhibitor and their</p><p>assigns or successors, and the heirs, assigns, administrators, legal representatives, executors or successors as the</p><p>case may be. This Agreement will not take effect and there will be no obligation by either party unless it is</p><p>countersigned by Organizer. It will be effective on the date countersigned by Organizer. This Agreement is fully or</p><p>partially assignable by Organizer in its sole discretion.</p><p>3</p><p>.</p><p>Whenever notice will or may be given to either of the parties by the other, each such notice will be by registered or</p><p>certified mail with return receipt requested, at the respective addresses of the parties as contained herein or to such</p><p>other address as either party may from time to time designate in writing to the other, and, if to Exhibitor, such notice</p><p>will be copied to Evan B. Azriliant, P.C, {{ADDRESS_2}}, 15th Floor, {{NAME_2}}, {{NAME_2}} 10017. Any notice under this</p><p>Agreement delivered by mail will be deemed to have been given three (3) days after it is placed in the mail with</p><p>sufficient postage prepaid. This Agreement contains all of the agreements between the parties hereto, supersedes all</p><p>prior and/or contemporaneous agreements and understandings and it may not be modified in any manner other than</p><p>by an agreement in writing signed by all the parties hereto or their successors in interest. The terms, covenants, and</p><p>conditions contained herein will inure to the benefit of and be binding upon Organizer and Exhibitor and their</p><p>respective heirs, personal representatives, successors and assigns, except as may be otherwise expressly provided in</p><p>the Agreement. Exhibitor acknowledges that neither Organizer nor any broker has made any representations to or</p><p>agreements with Exhibitor that are not contained in this Agreement. All obligations of Exhibitor that are or may be</p><p>intended by their nature to be performed and/or complied with after the expiration or earlier termination of this</p><p>Agreement will survive such expiration or termination. If any term or provision of this Agreement or the application</p><p>thereof to any person or circumstance will, to any extent, be determined by a court of competent jurisdiction to be</p><p>held illegal, invalid or unenforceable, then same will be deemed deleted from this Agreement as if never included</p><p>herein; but the remainder of this Agreement, or the application of such term or provision to persons or circumstances</p><p>other than those as to which it is held illegal, invalid or unenforceable, will not be affected thereby and each term and</p><p>provision of this Agreement will be valid and be enforced to the fullest extent permitted by law.</p><p>4</p><p>.</p><p>Unless otherwise approved by the {{NAME_6}}, Exhibitors will present one artist per 100 square foot of booth</p><p>space. The Exhibitor is required to present a museum hang with 18 inches in between pieces, no stacking of art, no</p><p>vinyls, and no labels larger than 2x5 inches. Exhibitors may only serve food and drink purchased from the official event</p><ul><li>caterers.</li></ul><h3>MIAMI BEACH</h3><ul><li>2024</li></ul><h3>Gallery: lovedtoo</h3><h3>Director: Thomas thomas</h3><h3>SCOPE {{NAME_1}}, Inc</h3><p>{{ADDRESS_3}}</p><h3>Brooklyn, NY</h3><ul><li>11217</li><li>{{PHONE_1}}</li></ul><h3>Director: {{NAME_7}}</h3><p>5</p><p>.</p><p>Organizer does not guarantee specific booth placements, booth configuration or booth square footage. Organizer</p><p>reserves the right to make changes in booth assignments, booth placements, booth square footage and/or booth</p><p>configuration within the Exhibition at its sole discretion at any time. The design and placement of booths will be</p><p>controlled and approved by Organizer exclusively, in its sole discretion. Furthermore, Organizer does not represent,</p><p>warrant or guarantee the final square footage of any booth space leased hereunder, it being expressly understood by</p><p>Exhibitor the actual square footage of a booth leased hereunder will be unknown until a final floor plan is received by</p><p>Organizer. Should the final floor plan received by Organizer (depicting the actual booth size to be leased to Exhibitor)</p><p>differ from the approximate booth square footage stated herein, the final floor plan will control and same will be</p><p>deemed to amend and supplement this Agreement so that the square footage of the booth size depicted in the final</p><p>floor plan will replace the approximate square footage stated herein, and the rental payments hereunder will be</p><p>adjusted accordingly.</p><p>6</p><p>.</p><p>Exhibitor will make no assignment or subletting nor will Exhibitor enter into license or concession agreements or</p><p>mortgage or hypothecate this Agreement or Exhibitor''s interest in and to the booth space or Exhibition premises or any</p><p>part thereof or permit any other party to conduct business or manage the booth space or control the operation thereof</p><p>(hereinafter collectively referred to as ''Transfer”), without the prior written consent of Organizer, which consent may be</p><p>granted or withheld at Organizer''s sole discretion. Consent by Organizer to any Transfer will not constitute a waiver of</p><p>the necessity for such consent to any subsequent Transfer. {{NAME_8}} by Exhibitor in accordance with this section</p><p>will be only for the purpose and use hereinabove specified and for no other purpose, and in no event will any Transfer</p><p>release or relieve Exhibitor from any obligations under this Agreement. Any permitted transferee will assume</p><p>Exhibitor''s obligations hereunder and will deliver to Organizer an assumption agreement in form satisfactory to</p><p>Organizer within five (5) days after the effective date of the Transfer. Exhibitor agrees to pay Organizer ‘s attorneys''</p><p>fees incurred in connection with the review and/or preparation of any documents in connection with any Transfer, and</p><p>in the event of a Transfer for rentals in excess of those rentals reserved hereunder, Exhibitor will pay all of such excess</p><p>rent to Organizer. Any attempt Transfer without Organizer''s consent will not be binding upon Organizer and will confer</p><p>no rights upon any third person.</p><p>7</p><p>.</p><p>Exhibitor must be registered and have completed full installation of Exhibitor booths by the dates and times outlined in</p><p>the {{NAME_4}} Center. {{NAME_9}} is allotted a specific load-in time for deliveries – time slots are scheduled</p><p>online in the {{NAME_4}} Center. Failure to arrive for your scheduled time slot may result in penalty, and you will</p><p>be rescheduled for a time slot at the convenience of the on-site operations team. Upon arrival to the event, Exhibitor''s</p><p>must first come to the front desk for the check-in and to pick up {{NAME_10}}. Exhibitor will not be able to bring</p><p>in/ drop off artwork until the check-in is completed.</p><p>8</p><p>.</p><p>Only once an Exhibitor''s booth is fully installed may the lighting adjustment request and curatorial approval request be</p><p>submitted. Lighting adjustment and curatorial approvals are conducted in the order they are submitted. A</p><p>representative of the gallery must be in the booth for these processes to be completed or the request will lose its place</p><p>in the order and be resubmitted at the convenience of the on-site staff. Lights will be adjusted to the best of</p><h3>Organizer''s ability.</h3><p>9</p><p>.</p><p>Lights are installed and adjusted by on-site electricians, according to the exhibitor''s specifications on their booth</p><p>sketch. Exhibitors are allotted a one-time adjustment of pre-installed lights. This is meant to be minimal and quick</p><p>adjustment (tilting up, down, left or right) of each light. The maximum duration of this one-time adjustment is no</p><p>more than 10 minutes for up to 15 lights, 15 minutes for up to 25 lights and 20 minutes for up to 40 lights or more per</p><p>booth. The relocation of lights beyond the one-time adjustment is not included, and can only be executed at additional</p><p>costs. For safety reasons, only on-site electricians may install, move, or adjust electrical connections and lights. Any</p><p>damages and failures to the electrical system, as a result of faulty connections, will be charged to the exhibitor.</p><p>10</p><p>.</p><p>All materials brought to the fair by the Exhibitor must be removed by Exhibitors. Exhibitor booth must be returned in</p><p>the same condition, which it was received. There will be a fee for each item mishandled before check-in or left in the</p><p>booth by Exhibitor after checkout, as well as an additional fee for unswept or damaged floor. All material used to hang</p><p>artwork must be removed from the walls and disposed of properly. All labels, letter sets, Velcro, or any other material</p><p>adhered to the wall must be removed. There will be a fee for each item left in or on booth walls. See below for charges</p><p>for mishandled items, Exhibitor damages, and items left in Exhibitor booth: Receiving improperly constructed crates,</p><p>tracking lost freight, oversized/Overweight freight handling, Exhibitor property left on site, late freight delivery/pick up,</p><p>late Set-Up/Break-Down after allotted hours, lost/damaged furniture, trash left on site, letterset and label removal,</p><p>repainting of walls back to white (Please note: exhibitors are not permitted to repaint their own walls), screws/hanging</p><p>material left in/on walls, damage to walls ( any holes larger than 1/2 inch), damage to floor, and artwork left onsite.</p><p>Additional charges include: Receiving improperly constructed crates {{NUMBER_1}} per crate; Tracking lost freight {{NUMBER_2}} per</p><p>hour; Oversized or Overweight freight handling {{NUMBER_3}} per item; Gallery property left onsite {{NUMBER_3}}; Late freight delivery</p><p>or pick-up {{NUMBER_2}} per hour; Late set-up or break-down after allotted hours {{NUMBER_2}} per hour; Lost or damaged furniture</p><p>{{NUMBER_1}} per item; Trash left onsite {{NUMBER_4}}; Screws left in walls {{NUMBER_5}}-{{NUMBER_6}} panel; Holes larger than 1/4 inch {{NUMBER_5}} per hole;</p><p>More than 10 holes per panel {{NUMBER_5}} per hole; Adhesive material, including, but not limited to, direct wallpaper</p><p>application, stickers, vinyl {{NUMBER_6}} per panel; Hanging material including, but not limited to, wood supports, cleats, etc.</p><p>{{NUMBER_6}} per panel; Painted walls without Organizer''s permission {{NUMBER_6}} per wall panel; Damage to floor {{NUMBER_1}} per {{NAME_11}};</p><ul><li>Artwork left onsite {{NUMBER_3}} per day.</li></ul><h3>INSURANCE</h3><p>1</p><p>.</p><p>All exhibitors are provided with insurance at no extra charge. This insurance policy includes all the required coverage</p><p>as well as commercial general liability, personal injury and blanket contractual liability insurance at limits of</p><p>{{NUMBER_7}} per occurrence and {{NUMBER_8}} per aggregate. This coverage will be evidenced by a certificate of insurance</p><p>(which will be emailed to you prior to the event) with a 30-day notice of cancellation provision to the insured and</p><p>naming SCOPE {{NAME_1}} inc as an additional insured and certificate holder.</p><p>2</p><p>.</p><p>It is strongly recommended the Exhibitor also carry insurance to cover loss, damage, or injury to any property of the</p><p>Exhibitor or to any of his officers, agents, employees or contractors, whether attributable to accident, fire, theft or any</p><p>other cause whatsoever. {{NAME_12}} may provide security guards, it is done solely as an accommodation to the</p><h3>Exhibitor.</h3><p>3</p><p>.</p><p>The Exhibitor expressly agrees to save and hold harmless Organizer, the lessor of the Exhibition facility, their</p><p>management, agents, employees, licensees, invitees and contractors from any and all claims, liabilities and losses for</p><p>injury to persons (including death) or damage to property arising in connection with Exhibitor''s use of the booth space</p><ul><li>and the Exhibition premises, and in connection with security personnel provided by Organizer.</li></ul><h3>FEES</h3><p>1</p><p>.</p><p>Booth fees are billed at {{NUMBER_9}} per square foot. {{NUMBER_10}} for 200 sq. ft. booth, {{NUMBER_11}} for 300 sq. ft. booth, {{NUMBER_12}} for</p><p>400 sq. ft. booth, {{NUMBER_13}} for 500 sq. ft. booth, and {{NUMBER_14}} for 600 sq. f.t booth. In addition to the booth fees, there</p><p>is a mandatory co-operative advertising fee of {{NUMBER_15}} for stand sizes 200-299 sq. ft., {{NUMBER_16}} for stand sizes 300-399</p><p>sq. ft., {{NUMBER_17}} for stand sizes 400-499 sq. ft, {{NUMBER_18}} for stand sizes 500-599 sq. ft., and {{NUMBER_19}} for 600 sq. ft. and</p><p>above. Exhibitor agrees to pay full cost of booth rental, mandatory charges, and additional charges. Additional items</p><p>will not be provided if payment has not been received in full upon receipt of invoice.</p><p>2</p><p>.</p><p>The balance of the booth rental and additional charges (i.e. less the deposit already received by Organizer) will be paid</p><p>by Exhibitor in TWO equal installments. The first of payment is due upon execution of agreement by both parties.</p><p>Booth placement may not be confirmed until after receipt of first payment. The final payment date will be noted on</p><p>Exhibitor''s first invoice. In the event Exhibitor fails to make any such scheduled payments and/or if any payment due</p><p>hereunder is delinquent more than five (5) calendar days past the due date, the Exhibitor''s booth location may be</p><p>assigned to a non-preferential area or any other area at the sole discretion of Organizer and a late charge of {{NUMBER_20}} per</p><p>square foot service charge will be added to the delinquent payment per week for every week payment is overdue.</p><p>Exhibitor may not be permitted to participate in the Exhibition unless all balances are paid in full by two weeks (14</p><p>days) prior to the show opening date. {{NAME_13}} allows payment to be made during check-in, a {{NUMBER_21}} fee will apply.</p><p>3</p><p>.</p><p>All payments made pursuant to this Agreement will be made exclusively in US currency. Payments made hereunder</p><p>may be made by cash, check (drawn on a US) bank or bank transfer (all wire transfers must include additional wiring</p><p>fees). Exhibitor booth invoice reflects a 4% discount when paying with cash, check, or wire transfer. This discount is</p><p>not applicable to payments made by credit card. Visa, MasterCard, Discover and {{NAME_14}} are accepted but</p><p>the 4% discount will be removed.</p><p>4</p><p>.</p><p>All sums of any kinds and character not paid by Exhibitor on their due date will bear interest at {{NUMBER_22}} per square foot per</p><p>week unless otherwise provided specifically to the contrary herein. {{NAME_13}} advances any funds to cure any default</p><p>by Exhibitor or performs any obligation on behalf of Exhibitor which requires an expenditure, Exhibitor will be obligated</p><p>to reimburse Organizer immediately upon demand thereon, for all such advances and expenditures, together with an</p><p>administrative/overhead charge equal to 15% of the amount thereof, plus interest thereon at eighteen percent (18%)</p><p>per annum from the date such funds are advanced or such expenditure is made. {{NAME_15}} fail to pay when due</p><p>any installment of rent or any other sum payable to Organizer under the terms of this Agreement, then, at Organizer ‘s</p><p>option, a charge equal to five percent (5%) of the amount due will be imposed to compensate Organizer for its</p><p>administrative costs in dealing with such late payment. Unless otherwise expressly provided herein, any consent or</p><p>approval of Organizer may be granted or withheld by Organizer in Organizer''s reasonable discretion.</p><p>5</p><p>.</p><p>In the event that Exhibitor fails to make any payments as agreed herein or breaches any term or condition contained</p><p>herein, Exhibitor will be in default hereunder, and Organizer will have the right to retain Exhibitor''s deposit and all</p><p>other monies paid hereunder, and reserves any other remedies it may have in law or in equity with respect to any</p><p>default by Exhibitor hereunder. In the event of default by Exhibitor, Organizer will have the right, but not the</p><p>obligation, to lease the subject booth space to another exhibitor prior to the Exhibition. Organizer is under no</p><p>obligation to lease all or part of the defaulting Exhibitor''s booth space; Exhibitor will remain liable for the full balance</p><p>due under the terms of this Agreement, together with all costs of collection, including but not limited to, all reasonable</p><p>attorneys'' fees, court costs and interest. In addition to any other defaults enumerated herein, Exhibitor will be in</p><p>default hereunder if Exhibitor fails to observe or perform any of the other terms, covenants and conditions of this</p><p>Agreement (or any other supplemental documents incorporated herein) and such default will continue for more than</p><p>fifteen (15) days after written notice from Organizer to Exhibitor. Exhibitor will have seven (7) days after written notice</p><p>from Organizer to cure any monetary default. Organizer will have all remedies available to Organizer at law and in</p><p>equity in the event of Exhibitor''s default under this Agreement, which remedies are cumulative and not mutually</p><p>exclusive, including, but not limited to, the right of acceleration. In the event of such default, Organizer may recover</p><p>from Exhibitor damages computed in accordance with the following formula, in addition to its other remedies: (a) any</p><p>unpaid rent and other sums due under this Agreement which have been earned at the time of such default or</p><p>termination; plus (b) the unpaid rent and other sums due under this Agreement for the balance of the term after the</p><p>time of default; plus (c) any other amount necessary to compensate Organizer for all the detriment caused by</p><p>Exhibitor''s failure to perform its obligation under this Agreement or which in the ordinary course of things would be</p><p>likely to result therefrom, including, attorneys'' fees and costs; plus (d) at Organizer''s election, such other amounts in</p><p>addition to or in lieu of the foregoing as may be permitted from time to time by the laws of the State of {{NAME_2}}; plus</p><p>(e) interest, the maximum amount permitted by law. In the event of default by Exhibitor, Exhibitor shall remain liable</p><p>for the full balance under the terms of the Agreement together with all costs of collection including, but not limited to,</p><p>all reasonable attorneys'' fees, court costs and interest. Any deposit remitted will be credited toward full payment of the</p><p>agreement fees. However, if Exhibitor has an outstanding balance from a previous event or publication, such deposit</p><p>and /or any payments received hereunder will be applied first to the oldest outstanding balance and the remainder to</p><ul><li>current application fees. Exhibitor remains responsible to pay the entire amount of this Agreement.</li></ul><h3>CONFIDENTIALITY</h3><p>1</p><p>.</p><p>Exhibitor will consider as confidential any and all information it receives in tangible form from Organizer that is marked</p><p>as Confidential or Proprietary and will use only for the purposes set forth above. Information which is disclosed orally</p><p>will be considered confidential information if it is reduced to writing and sent to the receiving party within two weeks of</p><p>the disclosure. Exhibitor agrees to receive and maintain all information in strictest confidence using care except as</p><p>provided herein and will not use information for own benefit or disclose it to third parties without written consent of</p><p>Organizer or use such information in a manner competitive to Organizer.</p><p>2</p><p>.</p><p>All financial agreements between Exhibitor and Organizer are solely between Exhibitor and Organizer and are</p><ul><li>considered confidential. Any breach of confidentiality will result in legal action.</li></ul><h3>INDEMNITY</h3><p>1</p><p>.</p><p>Exhibitor agrees to indemnify and hold Organizer, its employees, agents, invitees, licensees and contractors, and the</p><p>lessor of the Exhibition facility, harmless for any claims arising out of negligence of Exhibitor, its agents, or employees.</p><p>In addition to the foregoing, Exhibitor agrees to indemnify and save Organizer harmless from and against any and all</p><p>claims and demands for, or in connection with, any accident, injury or damage whatsoever caused by any person or</p><p>property arising directly or indirectly, out of the business conducted in or the use and/or occupancy of the Exhibition</p><p>premises, booth space or any part thereof, or arising directly or indirectly, from any act or omission of Exhibitor or any</p><p>concessionaire or sub-exhibitor or their respective licensees, servants, agents, employees, contractors or invitees, and</p><p>from and against any and all cost, expense and liabilities incurred in connection with any such claims and/or</p><p>proceedings brought thereon. The general liability coverage maintained by Exhibitor pursuant to this Agreement will</p><p>specifically insure the contractual obligation of Exhibitor as set forth in this section and/or as provided in this</p><h3>Agreement.</h3><p>2</p><p>.</p><p>The liability of Organizer for failure to perform its obligations under this Agreement is limited to a refund of the</p><p>Exhibitor''s deposits paid hereunder. In the event the Organizer will be in default hereunder in any respect, such default</p><p>will not give rise to any rights or remedies to Exhibitor unless and until such default will continue for more than thirty</p><p>(30) days after Organizer''s actual receipt of written notice thereof from Exhibitor (or, as to defaults not susceptible of</p><p>being cured within such thirty day period, Organizer fails to commence the cure thereof within such period and</p><p>thereafter diligently prosecute the same to completion). Further, if Organizer is delayed or prevented from performing</p><p>any of its obligations under this Agreement by reason of strike or labor troubles or any cause whatsoever beyond</p><p>Organizer''s control, the period of such delay or such prevention will be deemed added to the time herein provided for</p><p>the performance of any such obligation by Organizer in its sole discretion, may cancel this Agreement and the parties</p><p>hereto will be released of all further obligations and liabilities each may have to the other.</p><p>3</p><p>.</p><p>This Agreement, its Terms and Conditions, and the discussions, writings and negotiations of the parties hereto prior to</p><p>the effective date of the Agreement, and the terms and conditions of any addenda prepared in connection with this</p><p>Agreement (collectively the: confidential information”). Connection with the Agreement is confidential and will not</p><p>make any disclosures thereof, except for legal, accounting or tax purposes, or as required by law. The barred</p><p>disclosures referred to in this section include any such disclosures by oral communication, written communication,</p><p>television, audio, press, wire, internet and all other media. The terms and conditions of this Paragraph will survive the</p><p>termination or cancellation of this Agreement. Exhibitor agrees and acknowledges that the {{NAME_16}}, as</p><p>it exists from time to time, is a valuable, special and unique asset of Organizer and the that the terms and conditions</p><p>of this Paragraph are reasonable and necessary to protect the legitimate business interests of {{NAME_17}}</p><p>hereby acknowledges a violation or threatened violation of the terms and conditions of this Paragraph, whether by</p><p>Exhibitor or Exhibitor''s employees, agents and or representatives would cause irreparable injury or damages to</p><p>Organizer for which the damages would be inadequate compensation. Accordingly, Exhibitor acknowledges, consents</p><p>and agrees that in the event of any such violation or threatened violation, Organizer will be entitled to commence an</p><p>action for any preliminary, temporary and permanent injunctive relief and other equitable relief and it will be entitled to</p><p>any such relief without the necessity of alleging or proving actual damages, irreparable harm or lack of adequate</p><p>remedy at law and without posting a bond, and Organizer will further be entitled to such other rights and remedies it</p><p>may have at law or in equity, which rights and remedies will be cumulative and in addition to any other rights or</p><p>remedies available to Organizer.</p><p>4</p><p>.</p><p>In the event Exhibitor seeks to cancel this agreement for exhibition space, withdraw from the Exhibition, or reduce its</p><p>space requirements for the Exhibition, Exhibitor acknowledges that Organizer would be harmed and suffer loss and</p><p>that it would be difficult to determine the precise values for or amount of that harm. All cancellations, withdrawals or</p><p>requests for reduction in space by Exhibitor must be in writing, by certified mail, or by email. The date of cancellation,</p><p>withdrawal or reduction in space, as applicable, shall be the postmark date on the notice. {{NAME_18}} cancels,</p><p>withdraws or reduces its space requirements for the Exhibition, Exhibitor agrees to pay on demand to Organizer the</p><p>amounts set forth in this agreement if not previously paid by Exhibitor. Such payment shall be liquidated damages and</p><p>not penalty, and the parties agree that such amounts constitute a reasonable provision for liquidated damages. Written</p><p>{{NAME_19}}: (i) More than 90 days before show opening, deposit will not be refunded; (ii) 90 days or less prior to the</p><p>show opening, even if selected to participate within 90 days prior to the Exhibition opening, Exhibitor is responsible for</p><p>100% of total booth space cost. In the event of a space reduction, Exhibitor is responsible for the reduced space cost</p><p>AND the space reduction fee set forth above. If a reduction of space is requested, Exhibitor''s booth space on the</p><p>Exhibition floor may be moved by the sole discretion of Organizer.</p><p>5</p><p>.</p><p>Under no circumstances will the Organizer be liable to Exhibitor for the fulfillment of this Agreement if due to any act of</p><p>God or public enemy, including, but not limited to floods, wars, civil disturbance, sabotage, accidents, insurrections,</p><p>blockages, embargoes, storms, explosions, terrorism, labor disputes and/or acts of any governmental body,</p><p>postponement or cancellation of the event/show or for any cause beyond the control of Organizer. Exhibitor shall</p><p>obtain, at its own expense, adequate insurance against any risk of loss associated with the event/show being</p><p>cancelled, postponed, rescheduled, or relocated. In the event that the event/show is cancelled, postponed,</p><p>rescheduled, or relocated for any reason beyond the control of Organizer, Exhibitor shall remain liable to and shall pay</p><p>Organizer the full amount of the Exhibitor''s unpaid rental fees, together with any additional amounts due from</p><p>Exhibitor under this agreement. In the event of a cancellation of the event/show for any circumstance beyond the</p><p>control of the Organizer no refunds or credits shall be made by Organizer or any of its agents or representatives. Under</p><p>no circumstances will Organizer be liable for any loss of profits, loss of business, interruption of business or indirect,</p><p>special, incidental or consequential damages of any kind resulting from any breach of this agreement, even if the</p><p>damaged party has advised the other party of the possibility of such loss.</p><p>6</p><p>.</p><p>Upon acceptance by Exhibitor of the Terms and Conditions and E-{{NAME_20}} Notice, this Agreement is not</p><p>subject to cancellation or modification after execution and countersignature, except by mutual written Agreement</p><p>between the parties hereto. Exhibitors agree to be bound unconditionally by the Organizer''s rules and regulations as</p><ul><li>may be set forth by Organizer.</li></ul><h3>ELECTRONIC RECORD E-SIGN VERIFICATION</h3><p>1</p><p>.</p><p>Consent to {{NAME_21}} E-{{NAME_22}}, the {{NAME_23}} in Global and {{NAME_24}} Act (15</p><p>U.S.D. 7001, et seq.), requires that Exhibitor consent to entering into an electronic agreement with Organizer before</p><p>an Agreement can be executed. To access these documents and submit Exhibitor''s online Application, Exhibitor will</p><p>need a personal computer or Mac with Internet access and operational Internet browser software. Please read the</p><p>following information carefully: When you enter into this online Agreement with Organizer, you will not be required to</p><p>submit a paper application. An electronic record will evidence the entire Agreement between Exhibitor and Organizer.</p><p>However, Exhibitor must consent to the use of an electronic record and must read the {{NAME_25}} and Conditions</p><p>and electronically acknowledge below that Exhibitor have read these documents. By clicking on ''I agree” below,</p><p>Exhibitor consents to the use of electronic records evidencing Exhibitor agreement to the {{NAME_25}} and</p><p>Conditions. Exhibitor must Agree to Terms and Conditions to continue the application. Please verify the information</p><p>submitted on your enrollment form. If correct, acknowledge by checking the box below, which will serve as your</p><ul><li>Electronic signature. I certify that:</li></ul><h3>DEPOSIT REQUIREMENTS</h3><p>1</p><p>.</p><p>A refundable deposit of US {{NUMBER_23}} as well as a non-refundable processing fee of {{NUMBER_24}} is required with this application</p><p>for booth space within Exhibition. No applications will be accepted or space reserved without a deposit. {{NAME_18}} is</p><h3>I certify that I am</h3><h3>Thomas</h3><p>thomas</p><ul><li>, and I agree to</li></ul><p>be legally bound</p><ul><li>by this digital signature as legal</li></ul><p>representative of</p><p>lovedtoo</p><ul><li>on {{DATE_3}}</li><li>9:11 pm</li></ul><p>accepted, your deposit will be applied towards your booth fee. {{NAME_13}} is unable to accept your application, a full</p><p>refund of the {{NUMBER_19}} deposit will be issued, less a {{NUMBER_21}} administrative fee, 30 days after written notification that the</p><p>exhibitor is not accepted to the applied for edition of SCOPE {{NAME_26}}.</p><p>2</p><p>.</p><p>The information submitted is correct</p><p>3</p><p>.</p><p>I am a/the legal representative of the Exhibitor</p><p>4</p><p>.</p><p>I consent to the use of electronic records and have read, understand and agree to the {{NAME_27}} and</p><ul><li>{{NAME_21}} E-{{NAME_22}}.</li></ul><h3>Signed by Alexis</h3><h3>Hubshman</h3><p>as legal representative of</p><h3>SCOPE {{NAME_1}}, Inc.</h3><p>on {{DATE_3}} 9:11 pm</p>', 'body', '8.5x11', '{"top": "1in", "left": "1in", "right": "1in", "bottom": "1in"}', false, true, 'd807fb34-a10c-4d76-bc20-13b421c44bf7', NULL, '2025-11-04 00:08:38.002+00', '2025-11-04 00:08:38.002+00'),
	(7, 'testttt2', '', '<h2>Extracted from PDF (OCR with Layout Preservation)</h2><h4>Page 1</h4><p>ENSE PE</p><p>Initial Construction Control Document</p><p>To be submitted with the building permit application by a</p><p>Registered Design Professional</p><p>for work per the li'' edition of the</p><p>Massachusetts State Building Code, 780 CMR, Section</p><p>107.6.2</p><p>Project Title: 85 Tremont St. Cambridge, MA</p><p>Date: 07/03/2025</p><p>Property Address: 85 Tremont St. Cambridge, MA</p><p>Project: Check ( ) one or both as applicable: • New construction V Existing Construction</p><p>Project Description: Renovation of a Residential Multifamily (3+ Units (R2))</p><p>Designed per NFPA 13D</p><p>1, Jason Kahan, MA Registration Number: 48388 Expiration date: <span style="color: rgb(0, 0, 0); background-color: rgb(255, 235, 59);">{{DATE_2}}, a</span>m a registered design professional,</p><p>and hereby certify that I have prepared or directly supervised the preparation of all design plans, computations, and</p><p>specifications concerning'':</p><p>Entire Project</p><p>Fire Protection</p><p>Architectural</p><p>Electrical</p><p>Structural</p><p>MOther: Fire Alarm</p><p>Mechanical</p><p>for the above-named project and that such plans, computations, and specifications meet the applicable provisions of the</p><p>Massachusetts State Building Code, (780 CMR), and accepted engineering practices for the proposed project. I</p><p>understand and agree that I (or my designee) shall perform the necessary professional services and be present on the</p><p>construction site on a regular and periodic basis to:</p><p>1. Review, for conformance to this code and the design concept, shop drawings, samples, and other submittals</p><p>by the contractor in accordance with the requirements of the construction documents.</p><p>2. Perform the duties of registered design professionals in 780 CMR Chapter 17, as applicable.</p><p>3. Be present at intervals appropriate to the stage of construction to become generally familiar with the progress</p><p>and quality of the work and to determine if the work is being performed in a manner consistent with the</p><p>approved construction documents and this code.</p><p>When required by the building official, I shall submit field/progress reports (see item 3.) together with pertinent</p><p>comments, in a form acceptable to the building official.</p><p>Upon completion of the work, I shall submit to the building official a ''Final Construction Control Document''.</p><p>Enter in the space to the right a "wet"</p><p>or electronic signature and seal:</p><p>JASON CATALFO</p><p>KAHAN</p><p>FIRE PROTECTION</p><p>NO. 48388</p><p>REGISTERED</p><p>Phone number: 617-633-3522</p><p>Building Official Name:</p><p>Permit No.:</p><p>Email: JK@JASONKAHAN.COM</p><p>Building Official Use Only</p><p>Date:</p><p>07/03/2025</p><p>Note 1. Indicate with an ''x'' project design plans, computations and specifications that you prepared or directly supervised. If other'' is chosen,</p><p>provide a description.</p>', 'body', '8.5x11', '{"top": "1in", "left": "1in", "right": "1in", "bottom": "1in"}', false, true, 'd807fb34-a10c-4d76-bc20-13b421c44bf7', NULL, '2025-11-05 03:15:22.478+00', '2025-11-05 03:15:22.478+00'),
	(8, 'contract', '', '<p>This Application / Agreement ("Agreement") is between</p><h3>Thomas</h3><p>thomas</p><p>, owner or legal representative of</p><ul><li>lovedtoo</li></ul><p>("Exhibitor")</p><h3>AND</h3><h3>SCOPE {{NAME_1}} Inc</h3><ul><li>, a {{NAME_2}} corporation residing at {{ADDRESS_1}}., {{ADDRESS_4}}, {{NAME_3}} ("Organizer")</li></ul><h3>AGREEMENT</h3><p>1</p><p>.</p><p>The Terms and Conditions of this Agreement when signed electronically (and any addenda attached hereto) using the</p><p>Organizer''s {{NAME_4}} Center ("ERC") shall be the Terms and Conditions applicable to Exhibitor''s lease of</p><p>booth space from Organizer regarding participation in the contemporary art exhibition in {{NAME_5}}, {{NAME_3}}</p><p>known as SCOPE {{NAME_5}} 2024 during the dates of</p><p><span style="color: rgb(0, 0, 0); background-color: rgb(255, 235, 59);">{{DATE_1}}</span> - {{DATE_2}}</p><ul><li>("Exhibition"). All</li></ul><p>dates and location are subject to change and Organizer cannot be held liable for any changes in dates and or location.</p><p>Location of the Exhibition hours and preview is at the discretion of SCOPE {{NAME_1}} Inc. The Terms and Conditions of</p><p>this Agreement shall also cover any additional days required for Exhibitor to move-in and move-out of the booth space</p><p>at the Exhibition. Exhibitor and Organizer agree as follows:</p><p>2</p><p>.</p><p>This Agreement is governed solely by the laws of the State of {{NAME_2}}. In the event of any and all litigation arising</p><p>from this Agreement, the parties hereby agree that the sole venue for all legal action will lie exclusively in the</p><p>appropriate Courts of the City of {{NAME_2}}, {{NAME_2}}. The parties agree to waive trial by jury in any and all litigation</p><p>arising from this Agreement. In the event of any arbitration or litigation between the parties under this Agreement, the</p><p>prevailing party will be entitled to reasonable attorney''s fees and costs, in the arbitration and at both trial and</p><p>appellate levels. The parties have participated jointly in the negotiation and preparation of this Agreement. In the</p><p>event an ambiguity or question of intent or interpretation arises, this Agreement will be construed as if drafted jointly</p><p>by the parties and no presumption or burden of proof will arise favoring or disfavoring any party by virtue of the</p><p>authorship of any of the provisions of this Agreement. The parties intend that each covenant, term and condition</p><p>contained herein will have independent significance. If any party has breached any covenant, term or condition</p><p>contained herein in any respect, the fact that there exists another covenant, term or condition relating to the same</p><p>subject matter (regardless of the relative levels of specificity) which the party has not breached will not detract from or</p><p>mitigate the fact that the party is in breach of the first covenant, term or condition. The rights and remedies provided</p><p>by this Agreement are cumulative, and the use of any one right or remedy by either party will not preclude or waive its</p><p>right to use any or all other remedies. Said rights and remedies are given in addition to any other rights the parties</p><p>may have by law, statute, ordinance, or otherwise. Organizer may, in its sole and absolute discretion, waive any</p><p>covenant, term or condition or the breach thereof contained herein, however, no covenant, term or condition or the</p><p>breach thereof will be deemed waived, except by written consent of Organizer, and any waiver of the breach of any</p><p>covenant, term or condition contained herein will not be deemed to be a waiver of any preceding or succeeding breach</p><p>of the same or any other covenant, term or condition. This Agreement will bind both Organizer and Exhibitor and their</p><p>assigns or successors, and the heirs, assigns, administrators, legal representatives, executors or successors as the</p><p>case may be. This Agreement will not take effect and there will be no obligation by either party unless it is</p><p>countersigned by Organizer. It will be effective on the date countersigned by Organizer. This Agreement is fully or</p><p>partially assignable by Organizer in its sole discretion.</p><p>3</p><p>.</p><p>Whenever notice will or may be given to either of the parties by the other, each such notice will be by registered or</p><p>certified mail with return receipt requested, at the respective addresses of the parties as contained herein or to such</p><p>other address as either party may from time to time designate in writing to the other, and, if to Exhibitor, such notice</p><p>will be copied to Evan B. Azriliant, P.C, {{ADDRESS_2}}, 15th Floor, {{NAME_2}}, {{NAME_2}} 10017. Any notice under this</p><p>Agreement delivered by mail will be deemed to have been given three (3) days after it is placed in the mail with</p><p>sufficient postage prepaid. This Agreement contains all of the agreements between the parties hereto, supersedes all</p><p>prior and/or contemporaneous agreements and understandings and it may not be modified in any manner other than</p><p>by an agreement in writing signed by all the parties hereto or their successors in interest. The terms, covenants, and</p><p>conditions contained herein will inure to the benefit of and be binding upon Organizer and Exhibitor and their</p><p>respective heirs, personal representatives, successors and assigns, except as may be otherwise expressly provided in</p><p>the Agreement. Exhibitor acknowledges that neither Organizer nor any broker has made any representations to or</p><p>agreements with Exhibitor that are not contained in this Agreement. All obligations of Exhibitor that are or may be</p><p>intended by their nature to be performed and/or complied with after the expiration or earlier termination of this</p><p>Agreement will survive such expiration or termination. If any term or provision of this Agreement or the application</p><p>thereof to any person or circumstance will, to any extent, be determined by a court of competent jurisdiction to be</p><p>held illegal, invalid or unenforceable, then same will be deemed deleted from this Agreement as if never included</p><p>herein; but the remainder of this Agreement, or the application of such term or provision to persons or circumstances</p><p>other than those as to which it is held illegal, invalid or unenforceable, will not be affected thereby and each term and</p><p>provision of this Agreement will be valid and be enforced to the fullest extent permitted by law.</p><p>4</p><p>.</p><p>Unless otherwise approved by the {{NAME_6}}, Exhibitors will present one artist per 100 square foot of booth</p><p>space. The Exhibitor is required to present a museum hang with 18 inches in between pieces, no stacking of art, no</p><p>vinyls, and no labels larger than 2x5 inches. Exhibitors may only serve food and drink purchased from the official event</p><ul><li>caterers.</li></ul><h3>MIAMI BEACH</h3><ul><li>2024</li></ul><h3>Gallery: lovedtoo</h3><h3>Director: Thomas thomas</h3><h3>SCOPE {{NAME_1}}, Inc</h3><p>{{ADDRESS_3}}</p><h3>Brooklyn, NY</h3><ul><li>11217</li><li>{{PHONE_1}}</li></ul><h3>Director: {{NAME_7}}</h3><p>5</p><p>.</p><p>Organizer does not guarantee specific booth placements, booth configuration or booth square footage. Organizer</p><p>reserves the right to make changes in booth assignments, booth placements, booth square footage and/or booth</p><p>configuration within the Exhibition at its sole discretion at any time. The design and placement of booths will be</p><p>controlled and approved by Organizer exclusively, in its sole discretion. Furthermore, Organizer does not represent,</p><p>warrant or guarantee the final square footage of any booth space leased hereunder, it being expressly understood by</p><p>Exhibitor the actual square footage of a booth leased hereunder will be unknown until a final floor plan is received by</p><p>Organizer. Should the final floor plan received by Organizer (depicting the actual booth size to be leased to Exhibitor)</p><p>differ from the approximate booth square footage stated herein, the final floor plan will control and same will be</p><p>deemed to amend and supplement this Agreement so that the square footage of the booth size depicted in the final</p><p>floor plan will replace the approximate square footage stated herein, and the rental payments hereunder will be</p><p>adjusted accordingly.</p><p>6</p><p>.</p><p>Exhibitor will make no assignment or subletting nor will Exhibitor enter into license or concession agreements or</p><p>mortgage or hypothecate this Agreement or Exhibitor''s interest in and to the booth space or Exhibition premises or any</p><p>part thereof or permit any other party to conduct business or manage the booth space or control the operation thereof</p><p>(hereinafter collectively referred to as ''Transfer”), without the prior written consent of Organizer, which consent may be</p><p>granted or withheld at Organizer''s sole discretion. Consent by Organizer to any Transfer will not constitute a waiver of</p><p>the necessity for such consent to any subsequent Transfer. {{NAME_8}} by Exhibitor in accordance with this section</p><p>will be only for the purpose and use hereinabove specified and for no other purpose, and in no event will any Transfer</p><p>release or relieve Exhibitor from any obligations under this Agreement. Any permitted transferee will assume</p><p>Exhibitor''s obligations hereunder and will deliver to Organizer an assumption agreement in form satisfactory to</p><p>Organizer within five (5) days after the effective date of the Transfer. Exhibitor agrees to pay Organizer ‘s attorneys''</p><p>fees incurred in connection with the review and/or preparation of any documents in connection with any Transfer, and</p><p>in the event of a Transfer for rentals in excess of those rentals reserved hereunder, Exhibitor will pay all of such excess</p><p>rent to Organizer. Any attempt Transfer without Organizer''s consent will not be binding upon Organizer and will confer</p><p>no rights upon any third person.</p><p>7</p><p>.</p><p>Exhibitor must be registered and have completed full installation of Exhibitor booths by the dates and times outlined in</p><p>the {{NAME_4}} Center. {{NAME_9}} is allotted a specific load-in time for deliveries – time slots are scheduled</p><p>online in the {{NAME_4}} Center. Failure to arrive for your scheduled time slot may result in penalty, and you will</p><p>be rescheduled for a time slot at the convenience of the on-site operations team. Upon arrival to the event, Exhibitor''s</p><p>must first come to the front desk for the check-in and to pick up {{NAME_10}}. Exhibitor will not be able to bring</p><p>in/ drop off artwork until the check-in is completed.</p><p>8</p><p>.</p><p>Only once an Exhibitor''s booth is fully installed may the lighting adjustment request and curatorial approval request be</p><p>submitted. Lighting adjustment and curatorial approvals are conducted in the order they are submitted. A</p><p>representative of the gallery must be in the booth for these processes to be completed or the request will lose its place</p><p>in the order and be resubmitted at the convenience of the on-site staff. Lights will be adjusted to the best of</p><h3>Organizer''s ability.</h3><p>9</p><p>.</p><p>Lights are installed and adjusted by on-site electricians, according to the exhibitor''s specifications on their booth</p><p>sketch. Exhibitors are allotted a one-time adjustment of pre-installed lights. This is meant to be minimal and quick</p><p>adjustment (tilting up, down, left or right) of each light. The maximum duration of this one-time adjustment is no</p><p>more than 10 minutes for up to 15 lights, 15 minutes for up to 25 lights and 20 minutes for up to 40 lights or more per</p><p>booth. The relocation of lights beyond the one-time adjustment is not included, and can only be executed at additional</p><p>costs. For safety reasons, only on-site electricians may install, move, or adjust electrical connections and lights. Any</p><p>damages and failures to the electrical system, as a result of faulty connections, will be charged to the exhibitor.</p><p>10</p><p>.</p><p>All materials brought to the fair by the Exhibitor must be removed by Exhibitors. Exhibitor booth must be returned in</p><p>the same condition, which it was received. There will be a fee for each item mishandled before check-in or left in the</p><p>booth by Exhibitor after checkout, as well as an additional fee for unswept or damaged floor. All material used to hang</p><p>artwork must be removed from the walls and disposed of properly. All labels, letter sets, Velcro, or any other material</p><p>adhered to the wall must be removed. There will be a fee for each item left in or on booth walls. See below for charges</p><p>for mishandled items, Exhibitor damages, and items left in Exhibitor booth: Receiving improperly constructed crates,</p><p>tracking lost freight, oversized/Overweight freight handling, Exhibitor property left on site, late freight delivery/pick up,</p><p>late Set-Up/Break-Down after allotted hours, lost/damaged furniture, trash left on site, letterset and label removal,</p><p>repainting of walls back to white (Please note: exhibitors are not permitted to repaint their own walls), screws/hanging</p><p>material left in/on walls, damage to walls ( any holes larger than 1/2 inch), damage to floor, and artwork left onsite.</p><p>Additional charges include: Receiving improperly constructed crates {{NUMBER_1}} per crate; Tracking lost freight {{NUMBER_2}} per</p><p>hour; Oversized or Overweight freight handling {{NUMBER_3}} per item; Gallery property left onsite {{NUMBER_3}}; Late freight delivery</p><p>or pick-up {{NUMBER_2}} per hour; Late set-up or break-down after allotted hours {{NUMBER_2}} per hour; Lost or damaged furniture</p><p>{{NUMBER_1}} per item; Trash left onsite {{NUMBER_4}}; Screws left in walls {{NUMBER_5}}-{{NUMBER_6}} panel; Holes larger than 1/4 inch {{NUMBER_5}} per hole;</p><p>More than 10 holes per panel {{NUMBER_5}} per hole; Adhesive material, including, but not limited to, direct wallpaper</p><p>application, stickers, vinyl {{NUMBER_6}} per panel; Hanging material including, but not limited to, wood supports, cleats, etc.</p><p>{{NUMBER_6}} per panel; Painted walls without Organizer''s permission {{NUMBER_6}} per wall panel; Damage to floor {{NUMBER_1}} per {{NAME_11}};</p><ul><li>Artwork left onsite {{NUMBER_3}} per day.</li></ul><h3>INSURANCE</h3><p>1</p><p>.</p><p>All exhibitors are provided with insurance at no extra charge. This insurance policy includes all the required coverage</p><p>as well as commercial general liability, personal injury and blanket contractual liability insurance at limits of</p><p>{{NUMBER_7}} per occurrence and {{NUMBER_8}} per aggregate. This coverage will be evidenced by a certificate of insurance</p><p>(which will be emailed to you prior to the event) with a 30-day notice of cancellation provision to the insured and</p><p>naming SCOPE {{NAME_1}} inc as an additional insured and certificate holder.</p><p>2</p><p>.</p><p>It is strongly recommended the Exhibitor also carry insurance to cover loss, damage, or injury to any property of the</p><p>Exhibitor or to any of his officers, agents, employees or contractors, whether attributable to accident, fire, theft or any</p><p>other cause whatsoever. {{NAME_12}} may provide security guards, it is done solely as an accommodation to the</p><h3>Exhibitor.</h3><p>3</p><p>.</p><p>The Exhibitor expressly agrees to save and hold harmless Organizer, the lessor of the Exhibition facility, their</p><p>management, agents, employees, licensees, invitees and contractors from any and all claims, liabilities and losses for</p><p>injury to persons (including death) or damage to property arising in connection with Exhibitor''s use of the booth space</p><ul><li>and the Exhibition premises, and in connection with security personnel provided by Organizer.</li></ul><h3>FEES</h3><p>1</p><p>.</p><p>Booth fees are billed at {{NUMBER_9}} per square foot. {{NUMBER_10}} for 200 sq. ft. booth, {{NUMBER_11}} for 300 sq. ft. booth, {{NUMBER_12}} for</p><p>400 sq. ft. booth, {{NUMBER_13}} for 500 sq. ft. booth, and {{NUMBER_14}} for 600 sq. f.t booth. In addition to the booth fees, there</p><p>is a mandatory co-operative advertising fee of {{NUMBER_15}} for stand sizes 200-299 sq. ft., {{NUMBER_16}} for stand sizes 300-399</p><p>sq. ft., {{NUMBER_17}} for stand sizes 400-499 sq. ft, {{NUMBER_18}} for stand sizes 500-599 sq. ft., and {{NUMBER_19}} for 600 sq. ft. and</p><p>above. Exhibitor agrees to pay full cost of booth rental, mandatory charges, and additional charges. Additional items</p><p>will not be provided if payment has not been received in full upon receipt of invoice.</p><p>2</p><p>.</p><p>The balance of the booth rental and additional charges (i.e. less the deposit already received by Organizer) will be paid</p><p>by Exhibitor in TWO equal installments. The first of payment is due upon execution of agreement by both parties.</p><p>Booth placement may not be confirmed until after receipt of first payment. The final payment date will be noted on</p><p>Exhibitor''s first invoice. In the event Exhibitor fails to make any such scheduled payments and/or if any payment due</p><p>hereunder is delinquent more than five (5) calendar days past the due date, the Exhibitor''s booth location may be</p><p>assigned to a non-preferential area or any other area at the sole discretion of Organizer and a late charge of {{NUMBER_20}} per</p><p>square foot service charge will be added to the delinquent payment per week for every week payment is overdue.</p><p>Exhibitor may not be permitted to participate in the Exhibition unless all balances are paid in full by two weeks (14</p><p>days) prior to the show opening date. {{NAME_13}} allows payment to be made during check-in, a {{NUMBER_21}} fee will apply.</p><p>3</p><p>.</p><p>All payments made pursuant to this Agreement will be made exclusively in US currency. Payments made hereunder</p><p>may be made by cash, check (drawn on a US) bank or bank transfer (all wire transfers must include additional wiring</p><p>fees). Exhibitor booth invoice reflects a 4% discount when paying with cash, check, or wire transfer. This discount is</p><p>not applicable to payments made by credit card. Visa, MasterCard, Discover and {{NAME_14}} are accepted but</p><p>the 4% discount will be removed.</p><p>4</p><p>.</p><p>All sums of any kinds and character not paid by Exhibitor on their due date will bear interest at {{NUMBER_22}} per square foot per</p><p>week unless otherwise provided specifically to the contrary herein. {{NAME_13}} advances any funds to cure any default</p><p>by Exhibitor or performs any obligation on behalf of Exhibitor which requires an expenditure, Exhibitor will be obligated</p><p>to reimburse Organizer immediately upon demand thereon, for all such advances and expenditures, together with an</p><p>administrative/overhead charge equal to 15% of the amount thereof, plus interest thereon at eighteen percent (18%)</p><p>per annum from the date such funds are advanced or such expenditure is made. {{NAME_15}} fail to pay when due</p><p>any installment of rent or any other sum payable to Organizer under the terms of this Agreement, then, at Organizer ‘s</p><p>option, a charge equal to five percent (5%) of the amount due will be imposed to compensate Organizer for its</p><p>administrative costs in dealing with such late payment. Unless otherwise expressly provided herein, any consent or</p><p>approval of Organizer may be granted or withheld by Organizer in Organizer''s reasonable discretion.</p><p>5</p><p>.</p><p>In the event that Exhibitor fails to make any payments as agreed herein or breaches any term or condition contained</p><p>herein, Exhibitor will be in default hereunder, and Organizer will have the right to retain Exhibitor''s deposit and all</p><p>other monies paid hereunder, and reserves any other remedies it may have in law or in equity with respect to any</p><p>default by Exhibitor hereunder. In the event of default by Exhibitor, Organizer will have the right, but not the</p><p>obligation, to lease the subject booth space to another exhibitor prior to the Exhibition. Organizer is under no</p><p>obligation to lease all or part of the defaulting Exhibitor''s booth space; Exhibitor will remain liable for the full balance</p><p>due under the terms of this Agreement, together with all costs of collection, including but not limited to, all reasonable</p><p>attorneys'' fees, court costs and interest. In addition to any other defaults enumerated herein, Exhibitor will be in</p><p>default hereunder if Exhibitor fails to observe or perform any of the other terms, covenants and conditions of this</p><p>Agreement (or any other supplemental documents incorporated herein) and such default will continue for more than</p><p>fifteen (15) days after written notice from Organizer to Exhibitor. Exhibitor will have seven (7) days after written notice</p><p>from Organizer to cure any monetary default. Organizer will have all remedies available to Organizer at law and in</p><p>equity in the event of Exhibitor''s default under this Agreement, which remedies are cumulative and not mutually</p><p>exclusive, including, but not limited to, the right of acceleration. In the event of such default, Organizer may recover</p><p>from Exhibitor damages computed in accordance with the following formula, in addition to its other remedies: (a) any</p><p>unpaid rent and other sums due under this Agreement which have been earned at the time of such default or</p><p>termination; plus (b) the unpaid rent and other sums due under this Agreement for the balance of the term after the</p><p>time of default; plus (c) any other amount necessary to compensate Organizer for all the detriment caused by</p><p>Exhibitor''s failure to perform its obligation under this Agreement or which in the ordinary course of things would be</p><p>likely to result therefrom, including, attorneys'' fees and costs; plus (d) at Organizer''s election, such other amounts in</p><p>addition to or in lieu of the foregoing as may be permitted from time to time by the laws of the State of {{NAME_2}}; plus</p><p>(e) interest, the maximum amount permitted by law. In the event of default by Exhibitor, Exhibitor shall remain liable</p><p>for the full balance under the terms of the Agreement together with all costs of collection including, but not limited to,</p><p>all reasonable attorneys'' fees, court costs and interest. Any deposit remitted will be credited toward full payment of the</p><p>agreement fees. However, if Exhibitor has an outstanding balance from a previous event or publication, such deposit</p><p>and /or any payments received hereunder will be applied first to the oldest outstanding balance and the remainder to</p><ul><li>current application fees. Exhibitor remains responsible to pay the entire amount of this Agreement.</li></ul><h3>CONFIDENTIALITY</h3><p>1</p><p>.</p><p>Exhibitor will consider as confidential any and all information it receives in tangible form from Organizer that is marked</p><p>as Confidential or Proprietary and will use only for the purposes set forth above. Information which is disclosed orally</p><p>will be considered confidential information if it is reduced to writing and sent to the receiving party within two weeks of</p><p>the disclosure. Exhibitor agrees to receive and maintain all information in strictest confidence using care except as</p><p>provided herein and will not use information for own benefit or disclose it to third parties without written consent of</p><p>Organizer or use such information in a manner competitive to Organizer.</p><p>2</p><p>.</p><p>All financial agreements between Exhibitor and Organizer are solely between Exhibitor and Organizer and are</p><ul><li>considered confidential. Any breach of confidentiality will result in legal action.</li></ul><h3>INDEMNITY</h3><p>1</p><p>.</p><p>Exhibitor agrees to indemnify and hold Organizer, its employees, agents, invitees, licensees and contractors, and the</p><p>lessor of the Exhibition facility, harmless for any claims arising out of negligence of Exhibitor, its agents, or employees.</p><p>In addition to the foregoing, Exhibitor agrees to indemnify and save Organizer harmless from and against any and all</p><p>claims and demands for, or in connection with, any accident, injury or damage whatsoever caused by any person or</p><p>property arising directly or indirectly, out of the business conducted in or the use and/or occupancy of the Exhibition</p><p>premises, booth space or any part thereof, or arising directly or indirectly, from any act or omission of Exhibitor or any</p><p>concessionaire or sub-exhibitor or their respective licensees, servants, agents, employees, contractors or invitees, and</p><p>from and against any and all cost, expense and liabilities incurred in connection with any such claims and/or</p><p>proceedings brought thereon. The general liability coverage maintained by Exhibitor pursuant to this Agreement will</p><p>specifically insure the contractual obligation of Exhibitor as set forth in this section and/or as provided in this</p><h3>Agreement.</h3><p>2</p><p>.</p><p>The liability of Organizer for failure to perform its obligations under this Agreement is limited to a refund of the</p><p>Exhibitor''s deposits paid hereunder. In the event the Organizer will be in default hereunder in any respect, such default</p><p>will not give rise to any rights or remedies to Exhibitor unless and until such default will continue for more than thirty</p><p>(30) days after Organizer''s actual receipt of written notice thereof from Exhibitor (or, as to defaults not susceptible of</p><p>being cured within such thirty day period, Organizer fails to commence the cure thereof within such period and</p><p>thereafter diligently prosecute the same to completion). Further, if Organizer is delayed or prevented from performing</p><p>any of its obligations under this Agreement by reason of strike or labor troubles or any cause whatsoever beyond</p><p>Organizer''s control, the period of such delay or such prevention will be deemed added to the time herein provided for</p><p>the performance of any such obligation by Organizer in its sole discretion, may cancel this Agreement and the parties</p><p>hereto will be released of all further obligations and liabilities each may have to the other.</p><p>3</p><p>.</p><p>This Agreement, its Terms and Conditions, and the discussions, writings and negotiations of the parties hereto prior to</p><p>the effective date of the Agreement, and the terms and conditions of any addenda prepared in connection with this</p><p>Agreement (collectively the: confidential information”). Connection with the Agreement is confidential and will not</p><p>make any disclosures thereof, except for legal, accounting or tax purposes, or as required by law. The barred</p><p>disclosures referred to in this section include any such disclosures by oral communication, written communication,</p><p>television, audio, press, wire, internet and all other media. The terms and conditions of this Paragraph will survive the</p><p>termination or cancellation of this Agreement. Exhibitor agrees and acknowledges that the {{NAME_16}}, as</p><p>it exists from time to time, is a valuable, special and unique asset of Organizer and the that the terms and conditions</p><p>of this Paragraph are reasonable and necessary to protect the legitimate business interests of {{NAME_17}}</p><p>hereby acknowledges a violation or threatened violation of the terms and conditions of this Paragraph, whether by</p><p>Exhibitor or Exhibitor''s employees, agents and or representatives would cause irreparable injury or damages to</p><p>Organizer for which the damages would be inadequate compensation. Accordingly, Exhibitor acknowledges, consents</p><p>and agrees that in the event of any such violation or threatened violation, Organizer will be entitled to commence an</p><p>action for any preliminary, temporary and permanent injunctive relief and other equitable relief and it will be entitled to</p><p>any such relief without the necessity of alleging or proving actual damages, irreparable harm or lack of adequate</p><p>remedy at law and without posting a bond, and Organizer will further be entitled to such other rights and remedies it</p><p>may have at law or in equity, which rights and remedies will be cumulative and in addition to any other rights or</p><p>remedies available to Organizer.</p><p>4</p><p>.</p><p>In the event Exhibitor seeks to cancel this agreement for exhibition space, withdraw from the Exhibition, or reduce its</p><p>space requirements for the Exhibition, Exhibitor acknowledges that Organizer would be harmed and suffer loss and</p><p>that it would be difficult to determine the precise values for or amount of that harm. All cancellations, withdrawals or</p><p>requests for reduction in space by Exhibitor must be in writing, by certified mail, or by email. The date of cancellation,</p><p>withdrawal or reduction in space, as applicable, shall be the postmark date on the notice. {{NAME_18}} cancels,</p><p>withdraws or reduces its space requirements for the Exhibition, Exhibitor agrees to pay on demand to Organizer the</p><p>amounts set forth in this agreement if not previously paid by Exhibitor. Such payment shall be liquidated damages and</p><p>not penalty, and the parties agree that such amounts constitute a reasonable provision for liquidated damages. Written</p><p>{{NAME_19}}: (i) More than 90 days before show opening, deposit will not be refunded; (ii) 90 days or less prior to the</p><p>show opening, even if selected to participate within 90 days prior to the Exhibition opening, Exhibitor is responsible for</p><p>100% of total booth space cost. In the event of a space reduction, Exhibitor is responsible for the reduced space cost</p><p>AND the space reduction fee set forth above. If a reduction of space is requested, Exhibitor''s booth space on the</p><p>Exhibition floor may be moved by the sole discretion of Organizer.</p><p>5</p><p>.</p><p>Under no circumstances will the Organizer be liable to Exhibitor for the fulfillment of this Agreement if due to any act of</p><p>God or public enemy, including, but not limited to floods, wars, civil disturbance, sabotage, accidents, insurrections,</p><p>blockages, embargoes, storms, explosions, terrorism, labor disputes and/or acts of any governmental body,</p><p>postponement or cancellation of the event/show or for any cause beyond the control of Organizer. Exhibitor shall</p><p>obtain, at its own expense, adequate insurance against any risk of loss associated with the event/show being</p><p>cancelled, postponed, rescheduled, or relocated. In the event that the event/show is cancelled, postponed,</p><p>rescheduled, or relocated for any reason beyond the control of Organizer, Exhibitor shall remain liable to and shall pay</p><p>Organizer the full amount of the Exhibitor''s unpaid rental fees, together with any additional amounts due from</p><p>Exhibitor under this agreement. In the event of a cancellation of the event/show for any circumstance beyond the</p><p>control of the Organizer no refunds or credits shall be made by Organizer or any of its agents or representatives. Under</p><p>no circumstances will Organizer be liable for any loss of profits, loss of business, interruption of business or indirect,</p><p>special, incidental or consequential damages of any kind resulting from any breach of this agreement, even if the</p><p>damaged party has advised the other party of the possibility of such loss.</p><p>6</p><p>.</p><p>Upon acceptance by Exhibitor of the Terms and Conditions and E-{{NAME_20}} Notice, this Agreement is not</p><p>subject to cancellation or modification after execution and countersignature, except by mutual written Agreement</p><p>between the parties hereto. Exhibitors agree to be bound unconditionally by the Organizer''s rules and regulations as</p><ul><li>may be set forth by Organizer.</li></ul><h3>ELECTRONIC RECORD E-SIGN VERIFICATION</h3><p>1</p><p>.</p><p>Consent to {{NAME_21}} E-{{NAME_22}}, the {{NAME_23}} in Global and {{NAME_24}} Act (15</p><p>U.S.D. 7001, et seq.), requires that Exhibitor consent to entering into an electronic agreement with Organizer before</p><p>an Agreement can be executed. To access these documents and submit Exhibitor''s online Application, Exhibitor will</p><p>need a personal computer or Mac with Internet access and operational Internet browser software. Please read the</p><p>following information carefully: When you enter into this online Agreement with Organizer, you will not be required to</p><p>submit a paper application. An electronic record will evidence the entire Agreement between Exhibitor and Organizer.</p><p>However, Exhibitor must consent to the use of an electronic record and must read the {{NAME_25}} and Conditions</p><p>and electronically acknowledge below that Exhibitor have read these documents. By clicking on ''I agree” below,</p><p>Exhibitor consents to the use of electronic records evidencing Exhibitor agreement to the {{NAME_25}} and</p><p>Conditions. Exhibitor must Agree to Terms and Conditions to continue the application. Please verify the information</p><p>submitted on your enrollment form. If correct, acknowledge by checking the box below, which will serve as your</p><ul><li>Electronic signature. I certify that:</li></ul><h3>DEPOSIT REQUIREMENTS</h3><p>1</p><p>.</p><p>A refundable deposit of US {{NUMBER_23}} as well as a non-refundable processing fee of {{NUMBER_24}} is required with this application</p><p>for booth space within Exhibition. No applications will be accepted or space reserved without a deposit. {{NAME_18}} is</p><h3>I certify that I am</h3><h3>Thomas</h3><p>thomas</p><ul><li>, and I agree to</li></ul><p>be legally bound</p><ul><li>by this digital signature as legal</li></ul><p>representative of</p><p>lovedtoo</p><ul><li>on {{DATE_3}}</li><li>9:11 pm</li></ul><p>accepted, your deposit will be applied towards your booth fee. {{NAME_13}} is unable to accept your application, a full</p><p>refund of the {{NUMBER_19}} deposit will be issued, less a {{NUMBER_21}} administrative fee, 30 days after written notification that the</p><p>exhibitor is not accepted to the applied for edition of SCOPE {{NAME_26}}.</p><p>2</p><p>.</p><p>The information submitted is correct</p><p>3</p><p>.</p><p>I am a/the legal representative of the Exhibitor</p><p>4</p><p>.</p><p>I consent to the use of electronic records and have read, understand and agree to the {{NAME_27}} and</p><ul><li>{{NAME_21}} E-{{NAME_22}}.</li></ul><h3>Signed by Alexis</h3><h3>Hubshman</h3><p>as legal representative of</p><h3>SCOPE {{NAME_1}}, Inc.</h3><p>on {{DATE_3}} 9:11 pm</p>', 'body', '8.5x11', '{"top": "1in", "left": "1in", "right": "1in", "bottom": "1in"}', false, true, 'd807fb34-a10c-4d76-bc20-13b421c44bf7', NULL, '2025-11-05 18:43:21.739+00', '2025-11-05 18:43:21.739+00');
